import React from 'react';

const InputMain = () => {
    return (
        <div>
               <label >
            type='number' 
            value={minutesInput} 
            onChange={e => setMinutesInput(parseInt(e.target.value))} 
            </label>
            <label>
                color='secondary'
                type='number'
                value={secondsInput}
                onChange={e => setSecondsInput(parseInt(e.target.value))}
                </label>
        </div>
    );
};

export default InputMain;
